Kinderlieder, Kinderlieder und noch mehr Kinderlieder. Dieser YouTube Kanal bietet Euch hervorragend produziert und gesungene Kinderlieder aus Kindergärten, Kitas, Kigas, Babykursen, Grundschulen, Kinderpartys und von überall her, wo Kinderlieder gesungen werden. Ihr findet hier jede Menge Musik aus der überaus erfolgreichen Kinderlieder CD Serie "Die 30 besten". Ob für die Kinderparty, dem Morgenkreis im Kindergarten, zum Einschlafen, für die ersten Bewegungsabläufe oder die ersten Lerninhalte: "Die 30 besten"-Serie ist ein treuer Begleiter für die ersten Lebensjahre eures Kindes. Eine sorgsam recherchierte Liederauswahl sowie die angenehmen und fröhlichen Stimmen von Simone Sommerland, Karsten Glück und den Kita-Fröschen machen die Kinderlieder so besonders. 

